// src/pages/order/SellerCustomerListPage.jsx
import { useEffect } from "react";
import { useCRUD } from "../../hook/useCRUD";
import {
  getCustomer,
  createCustomer,
  updateCustomer,
  deleteCustomer,
} from "../../api/CustomerAPI";
import ModalComponent from "../../components/ModalComponent";
import SellCustomerForm from "../../form/order/SellCustomerForm";
import ButtonComponent from "../../components/ButtonComponent";
import BackButtonComponent from "../../components/BackButtonComponent";
import { initForms } from "../../arrays/TableArrays";
import { sellCustomerArray } from "../../arrays/SellerCustomerArray";
import { useNavigate } from "react-router-dom";

const api = {
  getAll: getCustomer,
  create: createCustomer,
  // üîß useCRUD.handleUpdateÍ∞Ä formData ÌÜµÏß∏Î°ú ÎÑòÍ∏∞ÎãàÍπå Ïó¨Í∏∞ÏÑú ÎûòÌïë
  update: (formData) => updateCustomer(formData.cusNo, formData),
  delete: (cusNo) => deleteCustomer(cusNo),
};

const SellerCustomerListPage = () => {
  const navigate = useNavigate();

  const {
    items,            // Î™©Î°ù
    setItems,
    formData,         // Ìèº ÏÉÅÌÉú
    handleChange,     // input onChange
    handleCreate,     // Îì±Î°ù
    handleUpdate,     // ‚úÖ ÏàòÏ†ï Î≤ÑÌäºÏóê Ïó∞Í≤∞
    handleDelete,     // ‚úÖ ÏÇ≠Ï†ú Î≤ÑÌäºÏóê Ïó∞Í≤∞
    openCreate,       // Îì±Î°ù Î™®Îã¨ Ïó¥Í∏∞
    openEdit,         // ÏàòÏ†ï Î™®Îã¨ Ïó¥Í∏∞ (Ìñâ ÌÅ¥Î¶≠)
    closeCreate,
    closeEdit,
    isCreateOpen,
    isEditOpen,
    selectedItem,
  } = useCRUD({
    initFormData: () => initForms.sellerCustomer,
    api,
    keyField: "cusNo",
  });

  useEffect(() => {
    (async () => {
      const data = await getCustomer();
      setItems(data);
    })();
  }, [setItems]);

  return (
    <div className="page-wrapper">
      <BackButtonComponent text="<  Ïù¥Ï†ÑÌéòÏù¥ÏßÄ" onClick={() => navigate(-1)} />
      <h2 style={{ textAlign: "center" }}>ÌåêÎß§Í±∞ÎûòÏ≤ò Î¶¨Ïä§Ìä∏</h2>

      {/* ÌÖåÏù¥Î∏î */}
      <table>
        <thead>
          <tr>
            {sellCustomerArray.map(col => <th key={col.id}>{col.content}</th>)}
          </tr>
        </thead>
        <tbody>
          {items && items.length > 0 ? (
            items.map(row => (
              <tr key={row.cusNo} className="row" onClick={() => openEdit(row)}>
                {sellCustomerArray.map(col => (
                  <td
                    key={col.id}
                    style={col.clmn === "cusComp" ? { color: "blue", textDecoration: "underline", cursor: "pointer" } : {}}
                  >
                    {row[col.clmn]}
                  </td>
                ))}
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan={sellCustomerArray.length} style={{ textAlign: "center" }}>
                Îç∞Ïù¥ÌÑ∞Í∞Ä ÏóÜÏäµÎãàÎã§.
              </td>
            </tr>
          )}
        </tbody>
      </table>

      <br />
      <ButtonComponent onClick={openCreate} text="Í±∞ÎûòÏ≤ò Îì±Î°ù" cln="submit" />

      {/* Îì±Î°ù Î™®Îã¨ */}
      <ModalComponent
        isOpen={isCreateOpen}
        onClose={closeCreate}
        title="Í±∞ÎûòÏ≤ò Îì±Î°ù"
        onConfirm={handleCreate}
      >
        <SellCustomerForm formData={formData} onChange={handleChange} />
        <div className="btn-wrapper">
          <ButtonComponent text="Îì±Î°ù" onClick={handleCreate} cln="submit" />
        </div>
      </ModalComponent>

      {/* ÏàòÏ†ï/ÏÇ≠Ï†ú Î™®Îã¨: Ïó¨Í∏∞ÏÑú 'ÏôÑÎ£å(ÏàòÏ†ï)' Î≤ÑÌäº + 'ÏÇ≠Ï†ú' Î≤ÑÌäº */}
      <ModalComponent
        isOpen={isEditOpen}
        onClose={closeEdit}
        title="Í±∞ÎûòÏ≤ò ÏàòÏ†ï/ÏÇ≠Ï†ú"
        onConfirm={handleUpdate}
      >
        {selectedItem && (
          <>
            <SellCustomerForm formData={formData} onChange={handleChange} />
            <div className="btn-wrapper">
              {/* ÏôÑÎ£å Î≤ÑÌäº = ÏàòÏ†ï */}
              <ButtonComponent text="ÏôÑÎ£å" onClick={handleUpdate} cln="fixbtn" />
              {/* ÏÇ≠Ï†ú Î≤ÑÌäº */}
              <ButtonComponent text="ÏÇ≠Ï†ú" onClick={handleDelete} cln="delbtn" />
            </div>
          </>
        )}
      </ModalComponent>
    </div>
  );
};

export default SellerCustomerListPage;
